    public static int lengthOfLongestSubstring(String s) {
    	Set<Character> strSet = new LinkedHashSet<>();
    	String q="";
    	int len=0;
    	for(int i=0;i<s.length();i++) {
    		q=String.valueOf(strSet.toString()).replace(", ", "").replace("[", "").replace("]", "");
    		if(strSet.contains(s.charAt(i)) && s.charAt(i)==s.charAt(i-1))
				strSet.clear();
//    		if (!strSet.isEmpty())
//    			System.out.println(" debug: "+strSet.iterator().next());
//    		
			if(strSet.contains(s.charAt(i)) && s.charAt(i)==strSet.iterator().next())  {
				//System.out.println(" debug: "+s.charAt(i-strSet.size()));
				//strSet.remove(s.charAt(i-strSet.size()));	
				strSet.remove(strSet.iterator().next());
    		}
			else
			if(strSet.contains(s.charAt(i))) {
					int index = s.indexOf(s.charAt(i));
					//System.out.println("index: "+index);
					for(int j=0;j<index;j++) {
						//if(!s.contains(q))
						//strSet.remove(s.charAt(j));
						if (!strSet.isEmpty())
							strSet.remove(strSet.iterator().next());
					}
					
					//strSet.remove(s.charAt(i));
	    		}
			


    		strSet.add(s.charAt(i));
    		q=q+s.charAt(i);
    		//System.out.println("strSet: " +strSet.toString());
			if(len<strSet.size() && s.contains(q))
				len = strSet.size();
    	}
    	return len;   
    }
    
    
